data:
  definition: "токопроводящая жила, состоящая из ряда отдельных проволок, или стренг\
    \ все или некоторые из которых имеют обычно спиральную форму\r\nПримечание:\n\n\
    1.  Многопроволочная жила может быть круглого или фасонного сечения\n\n2.  Английский\
    \ термин «strand» применяется также для обозначения одиночной проволоки"
